import React from 'react';

function ResultScreen(){
    return(
        <>
            <div className={`w-screen h-screen fixed top-0 left-0 bg-black bg-opacity-40 z-40 transition-opacity duration-300 opacity-100`}></div>
            <div className='border fixed z-[45] border-neutral-200 bg-[rgb(10,10,10)] rounded-xl w-[300px] flex flex-col items-center text-white text-xl -translate-y-1/2 -translate-x-1/2 top-1/2 left-1/2'>
                <div className='w-full h-full relative'>
                    <h1>Your performance:</h1>
                    <p>Turns: 38</p>
                    <p>Time remaining: 1:38</p>
                    <p>Dinero earned: 273</p>
                    <div className='w-full flex justify-center items-center'>
                        <p>Play again?</p>
                    </div>
                </div>
            </div>
        </>
    );
}

export default ResultScreen;
